import React from "react";
import { Link, useParams } from "react-router-dom";

const PRODUCTS = [
  { id: "p1", title: "Zarina" },
  { id: "p2", title: "Anna" },
  { id: "p3", title: "Adiba" },
];
const ProductDetailPage = () => {
  const params = useParams();
  return (
    <div>
      <h1>Product Detail!</h1>

      <ul>
        {PRODUCTS.map((item) => {
          <li>
            <Link to={`/products/${item.id}`}></Link>
          </li>;
        })}
      </ul>
    </div>
  );
};

export default ProductDetailPage;
